import React from "react";
import { ReactDOM } from "react";

function Form()
{
    return (
        <div>

    <h1>Register</h1>

    <form>
        <label for="name">Name:</label>
        <input type="text" id="name" name="name" required></input><br></br><br></br>

        <label for="place">Place:</label>
        <input type="text" id="place" name="place" required></input><br></br><br></br>

        <label for="mobile">Mobile No:</label>
        <input type="tel" id="mobile" name="mobile" required pattern="[0-9]{10}"></input><br></br><br></br>

        <label for="doctor">Personal Doctor:</label>
        <input type="text" id="doctor" name="doctor" required></input><br></br><br></br>

        <label for="disease">Disease:</label>
        <input type="text" id="disease" name="disease" required></input><br></br><br></br>

        <input type="submit" value="Submit"></input>
    </form>

        </div>
    );

}

export default Form;
